import React from 'react';
import "./Ten.css";

const Ten = () => {
  return (
    <div className='containet ten'>
        <div className='row'>
            <div className='col-md-3'>
              <img src='../101.jpg'/>
            </div>
        </div>
    </div>
  )
}

export default Ten
